import React, { useState } from "react";
import axios from "axios";

const Radio = ({ type, setType }) => {
  return (
    <div>
      <div>
        <label>
          <input
            type="radio"
            name="radio"
            checked={type}
            onChange={() => setType(!type)}
          />
          Title
        </label>
      </div>
      <div>
        <label>
          <input
            type="radio"
            name="radio"
            checked={!type}
            onChange={() => setType(!type)}
          />
          Author
        </label>
      </div>
    </div>
  );
};

const Home = ({ useQuery }) => {
  const [loading, setLoading] = useState(false);
  const [type, setType] = useState(true);
  const [books, setBooks] = useState([{}]);
  const [val, setVal] = useState("");
  const [next, setNext] = useState(1);
  const fetchData = async (url, parameters) => {
    const response = await axios.get(url, {
      params: parameters,
    });
    return response;
  };
  let url = "https://openlibrary.org/search.json";
  let parameters = {
    limit: 10,
    page: next,
  };
  if (type) {
    delete parameters.author;
    parameters.title = val;
  } else {
    delete parameters.title;
    parameters.author = val;
  }
  const { isLoading, data, isError, error } = useQuery(
    ["Books", next, val],
    fetchData(url, parameters),
    {
      skip: val,
    }
  );
  setLoading(isLoading);
  if (isError) {
    console.log(error);
  }
  console.log(data);
  setBooks([data.data.docs]);

  const handleSearch = async (boolean) => {
    if (!boolean) {
      if (next !== 0) {
        setNext(next - 1);
      }
    } else {
      setNext(next + 1);
    }
  };

  const popular = [
    "JavaScript",
    "Harry Potter",
    "Indian History",
    "Crypto Currency",
    "Criminal law",
  ];

  return (
    <div>
      {loading ? <h1> Async doing </h1> : ""}
      <input type="text" value={val} onChange={(e) => setVal(e.target.value)} />
      <button onClick={handleSearch}> Search </button>
      <Radio type={type} setType={setType} />
      <div>
        {popular.map((value) => {
          return (
            <div>
              <a
                target="_blank"
                href={`https://openlibrary.org/search?q=${value}`}
              >
                {value}
              </a>
              <br />
            </div>
          );
        })}
      </div>

      {Object.keys(books[0]).length ? (
        <div>
          <table>
            <tbody>
              <tr>
                <td> Title and Sub Title </td>
                <td> Author </td>
                <td> Latest Publish year</td>
                <td> First Publish year</td>
              </tr>

              {books.map((val) => {
                return val.map((inner) => {
                  return (
                    <tr>
                      <td>
                        {inner.title} {inner.subtitle}
                      </td>
                      <td> {inner.author_name[0]}</td>
                      <td> {Math.max.apply(null, inner.publish_year)}</td>
                      <td> {Math.min.apply(null, inner.publish_year)}</td>
                    </tr>
                  );
                });
              })}
            </tbody>
          </table>

          <button onClick={() => handleSearch(false)}>Previous</button>
          <button onClick={() => handleSearch(true)}>Next</button>
        </div>
      ) : (
        ""
      )}
    </div>
  );
};

export default Home;
